import React from 'react';

import './modal-login-window.css';

const ModalLoginWindow = () => {
    return (
        <div className="popup-login-window">
            <div className="flag"><div className="popup-login-window__close-button"></div></div>
            <div className="popup-login-window__wrapper">
                <p className="popup-login-window__title">АВТОРИЗАЦИЯ</p>
                <form className="login-form" method="post">
                    <p className="login-form__errors"></p>
                    <inputА/>
                    <p className="login-form__input"></p>
                    <p className="login-form__paragraph">Забыли пароль?</p>
                    <button type="submit" id="authenticate">Войти</button>
                    <p className="login-form__register"><a href="" className="login-form__register-link">Регистрация</a></p>
                </form>
            </div>
        </div>
    )
}

export default ModalLoginWindow;
